import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import DraftsIcon from '@material-ui/icons/Drafts';
import SendIcon from '@material-ui/icons/Send';
import Articulos from '../pages/Articulos';

const StyledMenu = withStyles({
    paper: {
      border: '1px solid #d3d4d5',
    },
  })(props => (
    <Menu

      elevation={0}
      getContentAnchorEl={null}
      anchorOrigin={{
        vertical: 'bottom',
        horizontal: 'center',
      }}
      transformOrigin={{
        vertical: 'top',
        horizontal: 'center',
      }}
      {...props}
    />
  ));

  const StyledMenuItem = withStyles(theme => ({
    root: {
      '&:focus': {
        backgroundColor: theme.palette.primary.main,
        '& .MuiListItemIcon-root, & .MuiListItemText-primary': {
          color: theme.palette.common.white,
        },
      },
    },
  }))(MenuItem);

  function menuItem(Component){
    return(
      <StyledMenuItem button component={Component} href={Component.props.uri}>
        <ListItemIcon>
          <SendIcon />
        </ListItemIcon>
        <ListItemText primary={Component.props.name} />
      </StyledMenuItem>
      )
  }



  export default function CustomizedMenus() {
    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = event => {
      setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
      setAnchorEl(null);
    };
    const art=<Articulos name="Articulos" uri="/articulos"/>
    return (
      <div>
        <Button style={{maxWidth: '20px', maxHeight: '26px', minWidth: '20px', minHeight: '26px'}}
          aria-controls="customized-menu"
          aria-haspopup="true"
          variant="contained"
          color="white"
          onClick={handleClick}
        >
          <svg style={{maxWidth: '15px', maxHeight: '15px', minWidth: '15px', minHeight: '15px'}} xmlns="http://www.w3.org/2000/svg" width="18" height="18" viewBox="0 0 18 18"><path d="M2 13.5h14V12H2v1.5zm0-4h14V8H2v1.5zM2 4v1.5h14V4H2z"/></svg>
        </Button>
        <StyledMenu
          id="customized-menu"
          anchorEl={anchorEl}
          keepMounted
          open={Boolean(anchorEl)}
          onClose={handleClose}
        >



          <StyledMenuItem button component="a" href="/articulos">
            <ListItemIcon>
              <DraftsIcon />
            </ListItemIcon>
            <ListItemText primary="Articulos"  />
          </StyledMenuItem>
          <StyledMenuItem button component="a" href="/about">
            <ListItemIcon>
              <InboxIcon />
            </ListItemIcon>
            <ListItemText primary="About"  />
          </StyledMenuItem>
        </StyledMenu>
      </div>
    );
  }
